import { useGetAllProductsQuery } from "../features/productsApi";

const Home = () => {
  const { data, error, isLoading } = useGetAllProductsQuery();
  return (
    <div className="home-container">
      {isLoading ? <p>Loading...</p> : error ? <p>An error occurred</p> : <></>}
    </div>
  );
};

export default Home;
